    constructor(props) {
        super(props);
    }


    render() {
        return (
                <div className="perktree-container">
                    <ul className="perk">
                        <li className="perk-level title"><span>Strength</span></li>
                        <Perklevel/>
                    </ul>
                </div>    
        )
    }
}
